import React from 'react'
import { useAuth } from './context/AuthContext'
import { useNavigate } from 'react-router-dom';
function Home() {
    const navigate = useNavigate();;
    const { user, logout } = useAuth();
    const handleLogOut = () =>{
        logout();
        navigate("/")
    }
  return (
    <div>Welcome

        <h1>{user?.name}</h1>
        <button className='bg-black text-white px-4 py-2 rounded' onClick={handleLogOut}>SALIR</button>
    </div>
  )
}

export default Home
